// src/App.js
import React from 'react';
import Header from './components/Header';
import LoginForm from './components/LoginForm.tsx';
import Hero from './components/Hero';
import ProductivityLanding from './components/ProductivityLanding';
import Footer from './components/Footer';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router> {/* Wrap your app with Router */}
      <div className="App">
        <Header /> {/* Header is rendered here. */}
        <main>
          <Routes> {/* Define your routes here */}
            <Route path="/" element={<ProductivityLanding />} />"
            <Route path="/" element={<Hero />} /> {/* Default route (/) renders Hero */}
            <Route path="/login" element={<LoginForm />} /> {/* /login route renders LoginForm */}
            {/* Other routes can be added here */}
          </Routes>
        </main>
        {/* <Footer /> */}
      </div>
    </Router>
  );
};

export default App;
